import './App.css';
import { Header } from './Mycomponents/Header'
import { About } from './Mycomponents/About';
import { Home } from './Mycomponents/Home'; // Import the Home component
import { Login } from './Mycomponents/Login';
import  History  from './Mycomponents/History'; // Import the History component
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate
} from "react-router-dom";
import Logout from './Mycomponents/Logout';


function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false); // Track login status
  const [chatLog, setChatLog] = useState([]);

  const clearChatLog = () => {
    setChatLog([]);
  };

  return (
    <Router>
      <Header mytitle="Placement Guidance Bot" />
      <Routes>
        <Route path="/" element={isLoggedIn ? <Navigate to="/home" /> : <Login setIsLoggedIn={setIsLoggedIn} />} />
        <Route path="/home" element={<Home chatLog={chatLog} setChatLog={setChatLog} />} />
        <Route path="/about" element={<About />} />
        <Route path="/new-chat" element={<Home chatLog={[]} setChatLog={setChatLog} />} />
        <Route path="/history" element={<History />} /> {/* Add this line for the history page */}
        <Route path="/logout" element={<Logout />} />
      </Routes>
    </Router>
  );
}

export default App;
